script: |
  super -f text -I q1366.spq | sort > q1366.out

inputs:
  - name: q1366.spq
    data: |
      SELECT ALL col1 * col1 + - col0 * + cor0.col1 * cor0.col1 - - 26 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q1366.out
    data: |
      -1326
      -13325
      -6274
